import React, { useState } from "react";
import styles from "./Skills.module.css"
import Technical from "./technical/Technical";
import Soft from "./soft/Soft";

const Skills = React.forwardRef((props,ref) => {
    const [skills, setSkills] = useState(true);

    return (
        <div className={styles.display__skills} ref={ref}>
            <h1 className={styles.display__title}>Skills</h1>
            <div className={styles.display__skillTitles}>
                { skills ? <button className={styles.tech__skills__selected} onClick={() => { setSkills(true); }}>Technical Skills</button> : <button className={styles.tech__skills} onClick={() => { setSkills(true); }}>Technical Skills</button>}
                { !skills ? <button className={styles.soft__skills__selected} onClick={() => { setSkills(false); }} >Soft Skills</button> : <button className={styles.soft__skills} onClick={() => { setSkills(false); }} >Soft Skills</button> }
            </div>
            <div className={styles.display__screen}>
                { skills ? <Technical /> : <Soft />}
            </div>
        </div>
    );
}); 

export default Skills;
